### Solution
To create a tooltip system where only one tooltip is open at a time, we can utilize React Context to manage the state of tooltips across the application. This approach allows us to keep track of which tooltip is currently open and close it when another tooltip is opened.

First, let's create a context for managing tooltips:

```jsx
// TooltipContext.js
import React, { createContext, useState } from 'react';

const TooltipContext = createContext();

const TooltipProvider = ({ children }) => {
  const [openTooltip, setOpenTooltip] = useState(null);

  const open = (id) => {
    setOpenTooltip(id);
  };

  const close = () => {
    setOpenTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ open, close, openTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export { TooltipProvider, TooltipContext };
```

Next, we'll modify the `Tooltip` component to use this context:

```jsx
// Tooltip.js
import React, { useContext, useState } from 'react';
import { TooltipContext } from './TooltipContext';

const Tooltip = ({ children, content, id }) => {
  const { open, close, openTooltip } = useContext(TooltipContext);
  const [isOpen, setIsOpen] = useState(false);

  const handleMouseOver = () => {
    if (openTooltip !== id) {
      open(id);
    }
    setIsOpen(true);
  };

  const handleMouseOut = () => {
    close();
    setIsOpen(false);
  };

  React.useEffect(() => {
    if (openTooltip !== id) {
      setIsOpen(false);
    }
  }, [openTooltip, id]);

  return (
    <div onMouseOver={handleMouseOver} onMouseOut={handleMouseOut}>
      {children}
      {isOpen && <div className="tooltip">{content}</div>}
    </div>
  );
};

export default Tooltip;
```

Finally, we need to wrap our application with the `TooltipProvider` to make the context available to all components:

```jsx
// pages/_app.js
import { TooltipProvider } from '../components/TooltipContext';

function MyApp({ Component, pageProps }) {
  return (
    <TooltipProvider>
      <Component {...pageProps} />
    </TooltipProvider>
  );
}

export default MyApp;
```

Now, when you use the `Tooltip` component, make sure to pass a unique `id` to each instance:

```jsx
