        Hover me!
      </Tooltip>
      <Tooltip id="tooltip-2" content="This is the second tooltip">
        Hover me too!
      </Tooltip>
    </div>
  );
}
```

This setup ensures that only one tooltip is open at a time across your application. When you hover over a new tooltip, the previously open one will close automatically. 

